import React from 'react'
import images from './img.js' // Import images object

const header = () => {
  return (
    <header class="d-flex flex-wrap justify-content-center py-3 mb-4 border-bottom">
      <a href="/" class="d-flex align-items-center mb-3 mb-md-0 me-md-auto text-dark text-decoration-none">
        <span class="fs-4">
          <img src={images.logo} width="300px" height="40px" />
        </span>
      </a>
      <ul class="nav nav-pills">
        <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Казань</a>
        <li class="nav-item"><a href="#" class="nav-link"> <img src={images.icon} width="30px" height="25px" /></a></li> {/ Access icon from images object /}
      </ul>
    </header>
  );
}

export default header
